import { Suspense } from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

import Home from "./pages/Home";
import ToolDetails from "./pages/ToolDetails";
import MainNavbar from "./components/ui/MainNavbar";
import { Toaster } from "./components/ui/sonner";

// üëâ —Å—Ç–∞—Ç–∏—á–Ω–∏ –∏–º–ø–æ—Ä—Ç–∏ –≤–º–µ—Å—Ç–æ lazy()
import Categories from "./pages/Categories";
import CategoryView from "./pages/CategoryView";
import Learn from "./pages/Learn";
import Planner from "./App"; // —Ç–≤–æ—è—Ç Planner (—Å—Ç–∞—Ä–∏—è—Ç App)

export default function AppRouter() {
  return (
    <BrowserRouter>
      <div className="min-h-screen bg-background text-foreground">
        <MainNavbar />
        <Suspense fallback={<div className="p-8 text-sm opacity-70">Loading‚Ä¶</div>}>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/categories" element={<Categories />} />
            <Route path="/categories/:cap" element={<CategoryView />} />
            <Route path="/learn" element={<Learn />} />
            {/* Discover –µ —Å–∫—Ä–∏—Ç –æ—Ç navbar, –Ω–æ –æ—Å—Ç–∞–≤–∞ –¥–æ—Å—Ç—ä–ø–µ–Ω */}
            <Route path="/discover" element={<Planner />} />
            <Route path="/tool/:id" element={<ToolDetails />} />
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </Suspense>
        <Toaster />
      </div>
    </BrowserRouter>
  );
}
